syntax = "proto3";
package fanxi;
import "RestfulBaseResponse.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "GetUserInfoResponseProto";

message GetUserInfoResponse {
   RestfulBaseResponse baseResponse=1;
   int64 gold=4;
   int64 cash=5;
   int32 levelId=6;
   int32 vipId=7;
   string registerDate=8;
   int32 status=9;
   string ip=10;
   
}




